import React from 'react';
const Cartitems = ({product}) => {
    return (  
        <div>
           <table class="table table-hover">

           <thead>
    <tr>
      <th scope="col">{product.iamge}</th>
      <th scope="col">{}</th>
      <th scope="col">Column heading</th>
      <th scope="col">Column heading</th>
    </tr>
  </thead>  
           </table>


        </div>
    );
}
 
export default Cartitems;
